import React from "react";

import 'bootstrap/dist/css/bootstrap.min.css';

const Login = () =>{
    return(
        <>
            <div className="login-page">
                <div className="container">
                    <div className="row">
                        <div className="col-md-6">Left</div>
                        <div className="col-md-6">Right</div>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Login;
